import React, { FunctionComponent } from 'react'

interface CardProps{
    title: string,
    text: string,
    img: string

}

const Card: FunctionComponent<CardProps> = ({title, text, img}) => {
    return (
        <div className=" w-screen bg-green-400">
            <img src="{img}" alt=""/>
            <h1>{title}</h1>
            <p>{text}</p>
        </div>
    )
}
export default Card
